import {React} from "react";
// import "./logi.css"


const  Login= ({auth}) => {
        return(
            <div className="login">
                <label>Login</label>
                <input type="text" id = "username"/>
                <label>Password</label>
                <input type="password" id="password" />
                    <button onClick={auth}>Login</button>
            </div>
        )
    }

export default Login
